        <Row style={{background:'blue'}}>
          <Col md={4}>1 of 3</Col>
          <Col md={4} xs={6}>2 of 3 (wider)</Col>
          <Col md={4}>3 of 3</Col>
        </Row>
      </Container>
    </>
  );
};

export default App;
